@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ATM a owl:Class .
:BankComputer a owl:Class .
:VerificationRequest a owl:Class .

:requestsVerification a owl:ObjectProperty ;
  rdfs:domain :ATM ;
  rdfs:range :VerificationRequest .

:checksVerification a owl:ObjectProperty ;
  rdfs:domain :BankComputer ;
  rdfs:range :VerificationRequest .

:hasSerialNumber a owl:DatatypeProperty ;
  rdfs:domain :VerificationRequest ;
  rdfs:range xsd:string .

:hasPassword a owl:DatatypeProperty ;
  rdfs:domain :VerificationRequest ;
  rdfs:range xsd:string .

:hasBankCode a owl:DatatypeProperty ;
  rdfs:domain :VerificationRequest ;
  rdfs:range xsd:string .

:isValid a owl:DatatypeProperty ;
  rdfs:domain :VerificationRequest ;
  rdfs:range xsd:boolean .
